import Header from './header';
import NotFound404 from './Error';
import ProductSpring from './Product';
import CreateJava from './Create';
import LoginForm from './login';
import RegisterForm from './Register';
import Prod from './Prod';
import Edit from './Update';
import CreateCat from './CreateCat';
import Category from './Category';
import 'bootstrap/dist/css/bootstrap.min.css';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import PrivateRoute from './PrivateRoute';

const router = createBrowserRouter([
    {
        path: '/',
        element: <Header />,
        errorElement: <NotFound404 />,
        children: [
            {
                path: '/prod',
                element: <PrivateRoute roles={['USER', 'ADMIN']}><Prod /></PrivateRoute>,
            },
            {
                path: '/addproduct',
                element: <PrivateRoute roles={['ADMIN']}><CreateJava /></PrivateRoute>
            },
            {
                path: '/product',
                element: <PrivateRoute roles={['USER', 'ADMIN']}><ProductSpring /></PrivateRoute>
            },
            {
                path: '/category',
                element: <PrivateRoute roles={['USER', 'ADMIN']}><Category /></PrivateRoute>
            }
        ]
    },
    {
        path: '/login',
        element: <LoginForm />
    },
    {
        path: '/register',
        element: <RegisterForm />
    },
    {
        path: '/CreateCat',
        element: <PrivateRoute roles={['ADMIN']}><CreateCat /></PrivateRoute>
    },
    {
        path: '/update/:prodId',
        element: <PrivateRoute roles={['ADMIN']}><Edit /></PrivateRoute>
    }
]);

export default function App() {
    return <RouterProvider router={router} />;
}
